// @ts-ignore
import React from "react";
import './style.css'

const NavBar = (props: any) => {
    const [navBarClass, setNavBarClass] = React.useState("navBarClosed")
    function navBarClosed() {
        var x = document.getElementById("navBar");
        if (x.style.display === "block") {
          x.style.display = "none";
        } else {
          x.style.display = "block";
        }
      }
    return (
        <div id="navBar" className="navBar">
            <div>
                <img className="burger" src="https://cdn-icons-png.flaticon.com/512/5358/5358649.png" alt="burger icon" onClick={navBarClosed} />
            </div>
        </div>
    )
}

export default NavBar
